function lengthOfLongestSubstring(s: string): number {
  // 1. build longest subStr
  // 2. test if substring recursively
  // 3. exit with first find
  function calculator(s: string): string {
    //Case 1: s1 defined && s0 !== s1 && s0 not in tempSubString done
    //Case 2: s1 defined && s0 !== s1 && s0 in tempSubString done
    //Case 3: s1 defined && s0 === s1 && s0 not in tempSubString
    // Case 4: s1 defined && s0 === s1 && s0 in tempSubstring
    // Case 5: s1 not defined && s0 defined && s0 not in tempSubString
    // case 6: S1 not defined && s0 defined && s0 in tempSubstring
    // else: exit
    if (s[1] && s[0] !== s[1] && !tempSubString.includes(s[0])) {
      tempSubString += s[0]
      return calculator(s.slice(1, s.length))
    } else if (s[1] && s[0] !== s[1] && tempSubString.includes(s[0])) {
      defSubString = tempSubString.length > defSubString.length ? tempSubString : defSubString
      tempSubString = ''
      fullString = fullString.slice(1, fullString.length)
      return defSubString.length >= fullString.length ? defSubString : calculator(fullString)
    } else if (s[1] && s[0] === s[1] && !tempSubString.includes(s[0])) {
      tempSubString += s[0]
      defSubString = tempSubString.length > defSubString.length ? tempSubString : defSubString
      tempSubString = ''
      fullString = fullString.slice(1, fullString.length)
      return defSubString.length >= fullString.length ? defSubString : calculator(fullString)
    } else if ( s[1] && s[0] === s[1] && tempSubString.includes(s[0])) {
      defSubString = tempSubString.length > defSubString.length ? tempSubString : defSubString
      tempSubString = ''
      fullString = fullString.slice(1, fullString.length)
      return defSubString.length >= fullString.length ? defSubString : calculator(fullString)
    } else if (!s[1] && s[0] && !tempSubString.includes(s[0])) {
      tempSubString += s[0];
      defSubString = tempSubString.length > defSubString.length ? tempSubString : defSubString;
      return defSubString
    } else if (!s[1] && s[0] && tempSubString.includes(s[0])) {
      defSubString = tempSubString.length > defSubString.length ? tempSubString : defSubString;
      return defSubString
    } else if (!s || s.length === 0) {
      return defSubString
    } else {
      return defSubString
    }
  }
  let fullString = s;
  let tempSubString = '';
  let defSubString = '';
  return calculator(s).length
};

